import React from "react";

import "./CardsPrin.css";

function CardsPrin() {
	return (
		<div>
			<h2 class="text-center m-4">NUESTROS PRODUCTOS</h2>

			<Card
				img="https://images.unsplash.com/photo-1448932223592-d1fc686e76ea"
				title="Computadores"
			/>
			<Card img="./assets/impresoras.jpg" title="Impresoras" />
		</div>
	);
}
function Card(props) {
	return (
		<div>
			<div class="contenedor  ">
				<div class="contenedor-cards  ">
					<div class="contenedor-card-item  ">
						<p class="tittle text-center">{props.title}</p>
						<div class="contenedor-card-item-wrapper">
							<img src={props.img} alt="" />
							<div class="contenedor-info">
								<div class="info">
									<button type="button " class="btn btn-warning">
										Ver mas
									</button>
								</div>
								<div class="fondo"></div>
							</div>
						</div>
					</div>
				</div>
			</div>
		</div>
	);
}
export default CardsPrin;
